// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Navbar from './components/navbar';
import ViewJobs from './pages/v';
import ViewQuotes from './pages/ViewQuotes';
import ViewInvoices from './pages/ViewInvoices';
import ViewProjects from './pages/ViewProjects';
import ViewClients from './pages/ViewClients';
import ViewUsers from './pages/ViewUsers';
import ViewInventories from './pages/ViewInventories';
import CreateJob from './pages/CreateJob';
import CreateQuote from './pages/CreateQuote';
import CreateInvoice from './pages/CreateInvoice';
import CreateProject from './pages/CreateProject';
import CreateClient from './pages/CreateClient';
import CreateUser from './pages/CreateUser';
import CreateInventory from './pages/CreateInventory';

const App = () => {
  return (
    <Router>
      <Navbar />
      <Switch>
        <Route path="/jobs/view" component={ViewJobs} />
        <Route path="/jobs/create" component={CreateJob} />
        <Route path="/quotes/view" component={ViewQuotes} />
        <Route path="/quotes/create" component={CreateQuote} />
        <Route path="/invoices/view" component={ViewInvoices} />
        <Route path="/invoices/create" component={CreateInvoice} />
        <Route path="/projects/view" component={ViewProjects} />
        <Route path="/projects/create" component={CreateProject} />
        <Route path="/clients/view" component={ViewClients} />
        <Route path="/clients/create" component={CreateClient} />
        <Route path="/users/view" component={ViewUsers} />
        <Route path="/users/create" component={CreateUser} />
        <Route path="/inventories/view" component={ViewInventories} />
        <Route path="/inventories/create" component={CreateInventory} />
        {/* Add other routes as needed */}
      </Switch>
    </Router>
  );
};

export default App;
